export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplay: true,
      autoplaySpeed: 10000,
      fade:true

    };
    return (
      <div>

        <Slider {...settings}>
          <div >
            <div className="first"></div>
          </div>
          <div>
          <div className="second"></div>

          </div>

        </Slider>
      </div>
    );
  }
}
